import React from "react";

const ContentApiDetails = ({ covid }) => {
  const { TotalPositive, TotalDeath } = covid;
  // // console.log(prop.apiDetails.covid);
  console.log(TotalPositive);
  return (
    <div>
      <ul>
        <li>{TotalPositive}</li>
        {/* <li>{covid.TotalDeath}</li>
        <li>{covid.TotalRecovered}</li> */}
      </ul>
    </div>
  );
};

export default ContentApiDetails;
